static Mask kLargeMask(kLargeMaskWidth, kLargeMaskHeight, kLargeMaskPixelData, kAlpha);
static Mask kSmallMask(kSmallMaskWidth, kSmallMaskHeight, kSmallMaskPixelData, kAlpha);

Mask const* Mask::selectMask(int width, int height, int& leftMargin, int& bottomMargin)
{
	Mask* candidate = width >= 1024 ? &kLargeMask : &kSmallMask;

	if (height < candidate->height_) {
		return nullptr;
	} else {
        if (width >= 1024) {
            if (height <= 68) {
                bottomMargin = height - 64;
            } else {
                bottomMargin = (int)floor(height / 12.0);
            }

            leftMargin = (int)floor(width / 10.0);
        } else {
            if (height <= 50) {
                bottomMargin = height - 48;
            } else {
                bottomMargin = (int)floor(height / 12.0);
            }

            if (width <= 104) {
                leftMargin = width - 96;
            } else {
                leftMargin = (int)floor(width / 10.0);
            }
        }
		return candidate;
	}
}
